import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";

function App()
{
    return(
    <div>
            <Header/>
            <Footer />
            <Note title="Study" content="Learn DSA & OOP"/>
            <Note />
        </div>
    )
};

export default App;
